        label: (<Link to="/mens-clothing">Men's Clothing</Link>),
        key: 'mens-clothing',
    },
];

const MenuBar = () => {
    return (<>
        <Menu mode="horizontal" items={items} 
        />
    </>);
};

export default MenuBar;
